import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './index.css';
const { PersonClient } = require('../matcha_grpc_web_pb');
const { createRequest } = require('../matcha_pb');


class SignUp extends Component {
	constructor(props) {
		super(props);
		this.state = {
			firstName: '',
			lastName: '',
			username: '',
			emailAdress: '',
			password: '',
			// confirmPassword: ''
		};
	}

	createUser = () => {
		const client = new PersonClient('http://10.43.1.110:8080');
		const request = new createRequest();
		request.setFirsname(this.state.firstName);
		request.setLastname(this.state.lastName);
		request.setUsername(this.state.username);
		request.setEmail(this.state.emailAdress);
		request.setPassword(this.state.password);
		client.createUser(request, {}, (err, response) => {
			if (err) {
				console.log(err.code);
				console.log(err.message);
			} else {
				console.log(response.getMessage());
			}
		})
	}

	render() {
		return (
			<div className="main">
				<div className="formpart">
					<div className="x"><Link to='/'>X</Link></div>
					<div id="signuplogo">MATCH<span className="red">A</span></div>
					<div id="getstarted">Get Started</div>
					<form
						onSubmit={e => {
							e.preventDefault()
							const { username, password } = this.state;
							this.loginAction ({
								username,
								password,
							})
					}}>
						<input
							type="text"
							placeholder="First Name"
							value={this.state.firstName}
							onChange={e => this.setState({ firstName: e.target.value })}
						/>
						<input
							type="text"
							placeholder="Last Name"
							value={this.state.lastName}
							onChange={e => this.setState({ lastName: e.target.value })}
						/>
						<input
							type="text"
							placeholder="Username"
							value={this.state.username}
							onChange={e => this.setState({ username: e.target.value })}
						/>
						<input
							type="text"
							placeholder="Email Adress"
							value={this.state.emailAdress}
							onChange={e => this.setState({ emailAdress: e.target.value })}
						/>
						<input
							type="password"
							placeholder="Password"
							value={this.state.password}
							onChange={e => this.setState({ password: e.target.value })}
						/>
						{/* <input
							type="password"
							placeholder="Confirm Password"
						/> */}
						<button
							id="signupsubmit"
							type="submit"
						>
							Sign Up
						</button>
					</form>
					<div className="existinguser">Already have an account? <Link to='/login'>Login</Link></div>
				</div>
			</div>
		);
	}
}

export default SignUp;
